import React from 'react';
import { Route } from 'react-router-dom';
import Homepage from './Components/homepage/homepage';
import './App.css';

const HatsPage = () => {
  <div>
    <h1>HATS PAGE</h1>
  </div>;
};

function App() {
  return (
    <div>
      <Route exact path='/' component={Homepage} />
    </div>
  );
}

export default App;
